Select 'Plantae' as Kingdom , 
--P.PhyName, C.ClaName, 
O.OrdName, F.FamName, G.GenName, S.SpcName, S.SpcAuthor, S.SpcInfraRank, S.SpcInfraEpithet, SpcInfraRankAuthor, S.SpcRecID, S.SpcStatus
